import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Import a separate CSS file for styling (optional)

function Navbar() {
  return (
    <nav className="navbar">
      <ul className="nav-list">
        <li className="nav-item"><a href="/hdl gen hub">
          <span style={{color:'orange'}}>HDL </span> Gen Hub
            </a></li>
        <li className="nav-item"><a href="/learn">Learn</a></li>
        <li className="nav-item"><a href="/about">Catalog</a></li>
        <li className="nav-item"><a href="/contact">About</a></li>
        <li className="nav-item"><a href="/help">Help</a></li>
        <div className="search-bar">
        <input type="text" placeholder="Search..." />
        <button className="search-button">Search</button>
      </div>
        

        <div className="auth-buttons">
        <Link to="/login" className="sign-in-button">Sign In</Link>
        <Link to="/registration" className="sign-up-button">Sign Up</Link>
        </div>

      </ul>
    </nav>
  );
}

export default Navbar;
